import { useState } from 'react';

export const Formulario = () => {

    const [form, setForm] = useState({
        mail: 'example@gmail.com',
        password: 'example123'
    })

    const onChange = (campo: string, valor: string) => {
        setForm({
            ...form,
            [campo]: valor
        })
    }

    return (
        <>
            <h2>Formulario</h2>

        </>
    )
}
